import React from 'react';
import { Typography } from "@material-tailwind/react";

const FOOTER_LINKS = [
  {
    title: "Quick Links",
    items: ["Home", "About Us", "Services", "Contact"],
  },
  {
    title: "Support",
    items: ["FAQ", "Help Center", "Privacy Policy", "Terms of Service"],
  },
];

function Footer() {
  return (
    <footer className="bg-gray-800 text-white py-8">
      <div className="container mx-auto px-4">
        <div className="flex flex-col md:flex-row justify-between">
          <div className="mb-6 md:mb-0">
            <Typography variant="h5" className="mb-4">MyCompany</Typography>
            <Typography variant="small" className="text-gray-400">
              1234 Street Name, City, State, 12345
            </Typography>
            <Typography variant="small" className="text-gray-400">Email: info@mycompany.com</Typography>
            <Typography variant="small" className="text-gray-400">Phone: (123) 456-7890</Typography>
          </div>
          <div className="flex flex-wrap">
            {FOOTER_LINKS.map(({ title, items }) => (
              <div key={title} className="w-full md:w-1/2 lg:w-1/4 mb-6 md:mb-0">
                <Typography variant="small" className="mb-4 font-semibold text-gray-300">{title}</Typography>
                <ul>
                  {items.map((link) => (
                    <li key={link}>
                      <Typography
                        as="a"
                        href="#"
                        className="block py-1 text-gray-400 hover:text-gray-200 transition"
                      >
                        {link}
                      </Typography>
                    </li>
                  ))}
                </ul>
              </div>
            ))}
          </div>
        </div>
        <div className="mt-8 border-t border-gray-700 pt-4 text-center">
          <Typography variant="small" className="text-gray-400">
            &copy; {new Date().getFullYear()} MyCompany. All rights reserved.
          </Typography>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
